Plugin Youtube!
Este plugin permite introducir contenidos del sitio web Youtube, como por ejemplo, videos.
&#xBF;C&#xF3;mo podemos instalar este plugin?$ npm install gitbook-plugin-youtube --save-dev

Una vez instalado, debemos incorporar el plugin en nuestro fichero book.json
{
    &quot;plugins&quot;: [&quot;youtube&quot;]
}

Finalmente, ejecutamos el siguiente comando para instalar y preparar el plugin:
$ gitbook install



